f42199c0-8e4c-4e47-b033-a8737cbf7727	Body Scan Relaxation	body_scan	Settle into a comfortable position, sitting or lying down. Let your eyes close if you feel comfortable. Take a slow, deep breath in, feel your lungs expand, and release it gently. Take another breath, even slower this time, and let any tension start to fall away.\nBring your attention to your feet. Curl your toes and tense the arches gently, just enough to feel the muscles switch on. Hold for a moment… then release and notice the softening. Move to your lower legs. Squeeze the calves lightly, hold… and let them melt.\nShift your focus to your thighs and glutes. Gently squeeze the muscles together, feeling the strength there. Hold… and release. Let the legs grow heavy. Draw your attention to your stomach and chest. Engage the muscles lightly, hold… and let everything loosen as you exhale.\nNow draw your attention to your back by cinching the shoulder blades together. Hold that gentle tension… then release and feel your upper body settle. Make light fists and tense your arms from hands to shoulders. Hold… and soften, letting your arms grow loose and warm.\nFinally, bring the focus to your face and neck. Tense the lips, eyes, and jaw just slightly… and release, letting the whole face relax.\nTake one more full-body breath in, gently engaging everything from head to toe… and as you exhale, let the entire body go limp and grounded. Notice the calm settling through you as the breath returns to a natural rhythm.	Settle into a comfortable position, sitting or lying down. Let your eyes close if that feels good. Take a slow, deep breath in, feel your lungs expand, and release it gently. Take another breath, even slower this time, and let any tension start to fall away.\nBring your attention to your feet. Curl your toes and tense the arches gently, just enough to feel the muscles switch on. Hold for a moment… then release and notice the softening. Move to your lower legs. Squeeze the calves lightly, hold… and 