f04fe503-e993-44f1-a91a-97fda475fda2	Leg pull prone	Mat-based	Advanced	Begin in a prone base position, resting on your forearms with the legs extended straight behind you, toes pointed and head in neutral. Draw the abdominals gently away from the mat, lengthening the spine while keeping the pubic bone in contact with the floor. To progress, lift the hips away from the mat so the weight is supported on the knees and forearms, maintaining a neutral spine in this static hold. To progress further, curl the toes under and straighten the legs, bringing the body into a full forearm plank, hips lifted and spine long. For the full version, straighten the arms to come up onto the hands. Keep the legs slightly apart and the head neutral. On the out-breath, lengthen and lift one leg to hip height; breathe in as you place it back down. Repeat on the opposite leg, performing this sequence 10 times.	TBC	Avoid hips sagging/loss of neutral\nAvoid hips sagging/loss of neutral\nReturn appropriately to mat	Prone	240	\N	[]	2025-11-14 17:35:24.630553+00	2025-12-18 12:13:42.420929+00	25	leg_pull_prone	extension	Y	Y	Y	Y	https://lixvcebtwusmaipodcpc.supabase.co/storage/v1/object/public/movement-voiceovers/3.25-Leg_pull_prone.mp3	80	t	\N
345ad9de-8eb8-4bcc-af6d-788971912e1f	Leg pull supine	Mat-based	Advanced	Begin in seated base with the hands placed flat on the floor slightly behind the hips, fingers pointing in toward the glutes and feet in dorsiflexion. On the out-breath, press through the hands and heels to lift the hips up toward the ceiling, forming a straight line from ankles to knees to hips, and point the toes into plantar flexion. Take a breath in to stabilise, and on the out-breath float one leg up, keeping the toes pointed; lower the leg back down on the in-breath. Repeat on the opposite leg, alternating sides for 10 repetitions, then gently lower the hips back to the mat.	TBC	Avoid hips dropping\nAvoid head sinking into shoulders, keep eyes focused forward	Supine	240	\N	[]	2025-11-14 17:35:24.67493+00	2025-12-18 12:13:42.420929+00	26	leg_pull_supine	extension	N	N	N	Y	https://lixvcebtwusmaipodcpc.supabase.co/storage/v1/object/public/movement-voiceovers/3.26-Leg_pull_supine.mp3	70	t	\N
ffb60707-ae05-4edf-8e97-950f19bb4884	Boomerang	Mat-based	Intermediate	Set up in seated neutral with the legs extended and the ankles crossed. Hinge forward slightly from the hips, lengthening the spine, and reach the arms behind you with the palms facing up. Breathe in as you roll back onto the shoulder blades, allowing the arms to reach forward as the legs sweep overhead. Switch the cross of the ankles, then breathe out as you roll forward, returning to the starting position with control. Repeat the movement, alternating the crossed position of the ankles each time, for a total of 10 repetitions.	TBC	Rolling back too far - weight onto shoulder blades only\nAvoid landing the legs to floor with a thump - control movement	Supine	240	\N	[]	2025-11-14 17:35:24.837151+00	2025-12-18 12:13:42.420929+00	29	boomerang	balance	N	N	N	Y	https://lixvcebtwusmaipodcpc.supabase.co/storage/v1/object/public/movement-voiceovers/3.29-Boomerang.mp3	65	t	\N
f86e969d-e10b-4ad4-9139-b09e1411b93a	Control balance	Mat-based	Advanced	Setup supine base. Breath in to prepare and on the out-breath, extend the arms overhead. Breath in here and on the out-breath lift both legs up and over the face until they come parallel to the floor behind you, balancing the weight between the shoulder blades. Breathe in as you lengthen one leg up toward the ceiling, keeping the pelvis stable. Breathe out as you switch legs, lowering one and lifting the other. Repeat this controlled leg exchange 10 times on each side, then gently roll the spine back down onto the mat.	TBC	Avoid weight on head and neck - maintain across shoulder blades\nAvoid collapsing the spine - activate glutes to keep lifted	Supine	240	\N	[]	2025-11-14 17:35:24.999526+00	2025-12-18 12:13:42.420929+00	33	control_balance	balance	N	N	N	Y	https://lixvcebtwusmaipodcpc.supabase.co/storage/v1/object/public/movement-voiceovers/3.33-Control_balance.mp3	70	t	\N
7230eede-09ef-461c-bd41-dc003481faae	Rocker with Open legs	Mat-based	Intermediate	This is Rocker with open legs. Set up seated base with your hands loosely placed on your ankles and toes together. Lengthen the legs as you breathe out, extending the legs up towards the ceiling, keeping the legs apart in a V-shape. Breathe in as you tilt the pelvis back and roll the spine back onto the mat. Breathe out as you return to the start position, bending the knees and returning the toes to the floor. To progress to the full version, keep the legs lengthened throughout, coming back into a balanced position at the top of each movement.	Rolling like a ball\nV shape position at top of movement\nPull up your socks (hands on ankles)	Rolling back too far onto neck\nEnsure rounding through the spine	Seated	240	\N	[]	2025-11-14 17:35:23.892074+00	2025-12-18 12:13:42.420929+00	9	rocker_with_open_legs	flexion	N	N	N	Y	https://lixvcebtwusmaipodcpc.supabase.co/storage/v1/object/public/movement-voiceovers/3.9-Rocker_with_open_legsmp3.mp3	70	t	\N
21a87cb1-ba6b-4f83-87d9-dc72778b26cd	The Swan Dive	Mat-based	Beginner	Set up prone base position on your stomach with the arms out to the side and flexed at the elbows, making a rectangle shape.\nOn the out-breath, lengthen the thoracic spine and float the head and chest off the floor, maintaining the lumbar spine and head in neutral. Breathe in as you return to the floor. The arms remain loosely in contact with the floor at all times.\nTo progress, keep the arms lifted off the floor as you lift and lower.\nTo progress to the full version, place the hands slightly wider than shoulder-width apart. On the out-breath, push the upper body up off the floor as you extend the arms, chest proud.\nBreathe in for preparation and on the out-breath, reach the arms forward and roll the chest onto the mat, lifting the legs up behind. Rock forwards and backwards 10 times.	'I surrender' position\nTurtle reaching head out of shell\nRocking back and forth on front of body	Avoid lifting from lumbar spine L1/L2\nMaintain smooth movement - avoid using momentum\nKeep head in neutral	Prone	240	\N	[]	2025-11-14 17:35:24.021318+00	2025-12-18 12:13:42.420929+00	12	the_swan_dive	extension	N	Y	Y	Y	https://lixvcebtwusmaipodcpc.supabase.co/storage/v1/object/public/movement-voiceovers/3.12-Swan_Dive.mp3	80	t	\N
f0cb1096-6cdc-49a0-9cf2-65b9d1089942	Side bend	Mat-based	Beginner	In a side-lined position, knees bent at a 90-degree angle in front of you, resting on your hip, place your supporting hand beneath your shoulder, fingers pointing away from you, and rest your top arm lightly by your side. Draw the abdominals in.\n\nLevel 1:\nBreathe in to prepare and on your out-breath, press through your supporting arm and lift the hips upward, away from the mat into a gentle side lift, shins still connected to the floor.\nBreathe in to hold, and breathe out to lower the hips back to the mat with control.\n\nLevel 2:\nProgress by extending the top arm towards the ceiling as you lift into the side bend, increasing the height of the lift while keeping the ribs soft.\n\nLevel 3:\nExtend the top arm overhead as you lift, creating a long arc from fingertips to knees. Maintain strong abdominal support and an open chest.\n\nFull version:\nExtend the legs, stacking them fully, and lift the hips into a full side plank. Sweep the top arm overhead into a long arc as you inhale, and return it to your side as you exhale, maintaining stability. Repeat this movement five times.\nLower with control and switch sides.	TBC	Collapsing into ribcage\nNeutral head position	Supine	240	\N	[]	2025-11-14 17:35:24.783027+00	2025-12-18 12:13:42.420929+00	28	side_bend	lateral	Y	Y	Y	Y	https://lixvcebtwusmaipodcpc.supabase.co/storage/v1/object/public/movement-voiceovers/3.28-Side_bend.mp3	120	t	\N
1765e870-9346-42f4-8e20-fd1b6d2ff6a7	Bicycle (& Scissors)	Mat-based	Intermediate	Lie on your back with legs extended and arms by your sides. Neutral spine, core engaged. Breathe in to prepare and on your out-breath imprint the spine and bring both legs into shoulder-stand position, bringing your back off the mat and with hands placed supporting your lower back.\nRotate the legs in a cycling movement for two movements as you breathe in and again for two movements as you breathe out.\nReverse the direction and repeat.	TBC	Neck compression - should be able to lift head off mat\nAvoid too much weight on hands - keep glutes active to stay lifted off mat	Supine	240	\N	[]	2025-11-14 17:35:24.242347+00	2025-12-18 12:13:42.420929+00	17	bicycle_scissors_	flexion	N	N	N	Y	https://lixvcebtwusmaipodcpc.supabase.co/storage/v1/object/public/movement-voiceovers/3.17-Bicycle.mp3	80	t	\N
e33a11f1-3591-4e36-b128-cfc30522267d	The Hundred	Mat-based	Beginner	Lie in your supine position, lying on your back. Find your neutral spine, core engaged, arms long by your sides.\n  Breathe in to prepare and on your out-breath, imprint the spine, drawing in the abdominals and float one leg to tabletop, thigh coming towards the chest from the hip until the knee is directly over the hip and the shin is \n  parallel to the floor.\n  To progress to level two, draw the abdominals in again, imprint the spine and bring the second leg to tabletop, matching the first. As you imprint the spine, the thighs will come slightly closer towards the chest to support the \n  lower back.\n  To progress to the full version, lower one leg at a time to the mat with control and extend both legs long on the mat, reaching through the toes without locking the knees. Arms stay long by your sides.\n  Breathe in to prepare and on your out-breath, draw the abdominals in and lift the head, neck and shoulders into a strong upper-ab curl while lifting the legs off the mat to your working height. Reach long through the \n  fingertips.\n  Begin the hundred pumps:\n  Pump the arms vigorously, inhaling for 5 counts and exhaling for 5 counts.\n  Keep the legs reaching long and the abdominals pulling back.\n  Complete 10 full breath cycles.\n  After the tenth cycle, lower the legs, one at a time, with control, and gently roll the spine and head back to the mat.	L1/L2 - coffee table position/ shin parallel\nFull version - toes towards lightswitch, beating arms	Abdominal doming/ back arching/ loss of neutral\nL1/ L2: Ensure knee over hip and shin parallel to floor	Supine	240	\N	[]	2025-11-14 17:35:23.161978+00	2025-12-18 12:13:42.420929+00	1	the_hundred	flexion	N	Y	Y	Y	https://lixvcebtwusmaipodcpc.supabase.co/storage/v1/object/public/movement-voiceovers/3.1-The_hundred.mp3	140	t	https://d1chkg8zq1g5j8.cloudfront.net/The_Hundred_Placeholder.mp4
0c17f249-7ea9-432b-a6cb-fe5759d20274	Neck pull	Mat-based	Intermediate	Lie on your back with legs extended hip-width, feet flexed and anchored, hands lightly behind the head as done in normal sit ups. Neutral spine, core engaged.\nBreathe in to prepare and on your out-breath, imprint the spine and curl the head, neck, and shoulders up, tucking in the chin and rolling through the spine until you sit tall.\nBreathe in to roll back from the hips with a long spine, breathe out to roll down with control one vertebra at a time.\nElbows stay wide without pulling on the head. Finish by lowering the head gently to the mat.	TBC	Avoid elbows coming forward, losing alignment with ears\nKeep movement flowing/smooth	Supine	240	\N	[]	2025-11-14 17:35:24.152196+00	2025-12-18 12:13:42.420929+00	15	neck_pull	flexion	N	N	N	Y	https://lixvcebtwusmaipodcpc.supabase.co/storage/v1/object/public/movement-voiceovers/3.15-Neck_pull.mp3	70	t	\N
e24e0389-d859-4b1a-947a-b0e5f1a4478f	Push up	Mat-based	Beginner	Stand in neutral spine setup at the back of your mat. Breathe in to prepare and breathe out as you roll the spine down toward the floor, taking another in-breath as you approach the mat. Breathe out as you walk the hands forward into a box position, placing the hands slightly wider than shoulder-width with the knees under the hips. Breathe in as you bend the elbows to lower the chest and breathe out as you press back up to the box. Breathe in as you walk the hands back toward the feet and breathe out as you roll the spine back up to your starting standing position. Repeat this sequence 10 times. To progress, on the next journey forward, walk the hands further out so the knees, hips, and shoulders form a long straight line. For the full version, walk out to the length of the body, curl the toes under, coming up onto your toes. Perform the push-up with ankles, knees, hips, and shoulders aligned.	TBC	Hingeing from hips - roll down should mobilise the spine\nElbows too close to body on press up - maintain soft elbows	Standing	240	\N	[]	2025-11-14 17:35:25.043598+00	2025-12-18 12:13:42.420929+00	34	push_up	extension	N	Y	Y	Y	https://lixvcebtwusmaipodcpc.supabase.co/storage/v1/object/public/movement-voiceovers/3.34-Push_up.mp3	80	t	\N
4b13e7b5-d008-4341-aa08-5a0d17042f86	Swimming - Box	Mat-based	Advanced	Position yourself on hands and knees (box position), spine long and neutral. Breathe in to prepare and on your out-breath extend one leg, then bring the knee back to the mat on the breath in. Repeat on the other leg.\n\nLevel 2:\nTo progress to level 2, bring in the arms and continue the motion set at level 1, alternating leg and arm each cycle. Switch sides with precision.\n\nFull version:\nFlow arm and leg extensions continuously, alternating sides while keeping the torso steady and abdominals engaged. Return to box and sit back into rest position.	TBC	Avoid pinching through the lower back (keep deep abdominals engaged)\nEnsure opposing arm/leg combination\nAvoid hips shifting (box position)	Prone	240	\N	[]	2025-12-13 20:50:56.112961+00	2025-12-18 12:13:42.420929+00	35	swimming_box	\N	N	Y	Y	Y	https://lixvcebtwusmaipodcpc.supabase.co/storage/v1/object/public/movement-voiceovers/3.35-Swimming_box.mp3	80	t	\N
b42af963-33b5-4f89-a6f4-ee55709ea4c6	The Saw	Mat-based	Beginner	Set up in seated neutral with the legs wider than hip distance apart. Raise the arms out to the sides as in Spine twist, keeping the shoulders relaxed. Breathe in as you rotate the torso to one side, keeping the spine tall and the glutes firmly connected to the mat. Breathe out as you fold forward in a spine stretch, reaching the front arm toward the opposite foot, little finger moving toward little toe, while the back arm reaches behind with the palm facing the ceiling. Breathe in as you rebuild the spine and return to upright, then rotate to the other side. Repeat this sequence 10 times, alternating sides.	Reaching little finger to little toes\nCementing sIT bones into the floor	Ensure rotation between each reach forward\nForcing the stretch\nAvoid pelvis leaving the mat on the reach	Seated	240	\N	[]	2025-11-14 17:35:23.980415+00	2025-12-18 12:13:42.420929+00	11	the_saw	rotation	N	N	N	Y	https://lixvcebtwusmaipodcpc.supabase.co/storage/v1/object/public/movement-voiceovers/3.11-The_Saw.mp3	70	t	\N
490f9721-9bfe-4b27-b2ea-78127b046868	The Roll Over	Mat-based	Advanced	From level 2 position of the 100, on the next out-breath, begin to peel the spine away from the floor, keeping your arms down by your side for support, and return to the start position. To progress to the full version, set up supine base position. Breathe out as you float your legs up towards the ceiling, toes pointed, peeling the spine away from the floor, continuing the movement until your legs are parallel to the floor. Then open the legs to hip width with the feet flexed. As you inhale, begin to roll the spine back down towards the mat, thus releasing the movement, keeping your arms down by your side. As the legs pass above the hips, bring them back together, pointing the toes, and exhale on the return to the mat. Repeat 10 times.	Peeling the spine away from the mat\nLegs parallel to floor when overhead	Weight on the head\nKeep upper body in contact with the floor when lowering back towards the mat\nUsing momentum to achieve rollover	Supine	240	\N	[]	2025-11-14 17:35:23.460325+00	2025-12-18 12:13:42.420929+00	3	the_roll_over	flexion	N	Y	N	Y	https://lixvcebtwusmaipodcpc.supabase.co/storage/v1/object/public/movement-voiceovers/3.3-Roll_over.mp3	80	t	\N
22014889-ea42-4925-a9d6-e0e5cbc32d06	Swimming - Prone	Mat-based	Advanced	Level 1:\nLie prone on your mat, head resting on your arms. Breathe in, drawing the abdominals gently away from the mat and on your out-breath, lift one leg slightly off the mat, then switch legs with controlled alternating lifts.\n\nLevel 2:\nProgress to level 2 by bringing in the arms. Continue the motion set at level 1, raising alternate arm and leg on each cycle.\n\nFull version:\nIncrease the pace of the arm and leg movement while keeping the torso long and stable, breathing steadily. Lower with control after your final cycle.	TBC	Avoid pinching through the lower back (keep deep abdominals engaged)\nEnsure opposing arm/leg combination\nAvoid hips shifting (box position)	Prone	240	\N	[]	2025-11-14 17:35:24.57715+00	2025-12-18 12:13:42.420929+00	24	swimming	extension	N	Y	Y	Y	https://lixvcebtwusmaipodcpc.supabase.co/storage/v1/object/public/movement-voiceovers/3.24-Swimming_prone.mp3	70	t	\N
79c29444-19b3-4dd1-bf0a-5524ecd70cc2	Spine twist	Mat-based	Beginner	Sit tall on your sit bones with legs extended in front, slightly wider than hip distance apart, feet flexed, arms stretched out to the sides in an embracing shape at shoulder height. Pull the abdominals in to lengthen the spine. Breathe in to prepare and on your out-breath rotate the torso to one side, pulsing a little further for two small controlled rotations without shifting the hips. Breathe in to return to centre. Repeat to the opposite side, maintaining lift through the spine and stability through the pelvis. Finish by returning to a centred, tall seated position.\n	Prayer position or cossack position\nSit tall in rotation - as if unscrewing the lid off a jam jar	Unable to maintain seated neutral\nAvoid shoulder blades lifting\nKeep sIT bones from lifting off the mat	Seated	240	\N	[]	2025-11-14 17:35:24.337735+00	2025-12-18 12:13:42.420929+00	19	spine_twist	rotation	N	Y	N	Y	https://lixvcebtwusmaipodcpc.supabase.co/storage/v1/object/public/movement-voiceovers/3.19-Spine_twist.mp3	70	t	\N
8a496de3-94d4-41f6-9cbb-c412dc2063df	Shoulder Bridge	Mat-based	Beginner	Set up supine base, heels close in towards the glutes, hands by your hips.\nBreathe in as you tilt the pelvis back imprinting the spine, and out as you return the spine into neutral. Increase the range of movement with each cycle, eventually lifting up into the bridge position with the shoulders, hips, and knees in a straight line or ski-slope position.\nBreathe in at the top and out as you return the spine one vertebra at a time to the mat.\n\nTo progress:\nWhen you next reach the bridge position, float the arms up and over the head as you breathe in, and breathe out as you return the arms and the body back down together.\n\nTo challenge further:\nLeave the arms above the head in the bridge position and return the spine down to the mat, followed by the arms on the breath in.\n\nFull version:\nIn bridge position, breathe in to prepare and on the out-breath lengthen and lift one leg up toward the ceiling.\nBreathe in as you lower the leg toward the floor, keeping the hips lifted; breathe out as you lift it back up and return the foot to its original position.\nRepeat on the opposite leg. Perform 10 repetitions.	TBC	Avoid lifting spine in chunks away from mat\nAvoid hip movement when lengthening leg\nMaintain height of hips	Supine	240	\N	[]	2025-11-14 17:35:24.285121+00	2025-12-18 12:13:42.420929+00	18	shoulder_bridge	extension	N	Y	Y	Y	https://lixvcebtwusmaipodcpc.supabase.co/storage/v1/object/public/movement-voiceovers/3.18-Shoulder_bridge.mp3	120	t	\N
dca9a295-4877-484f-a798-fb78a9c43012	The Roll Up	Mat-based	Beginner	Set up seated neutral with your hands loosely placed underneath your thighs, gently holding onto the hamstrings. Begin the movement with a posterior pelvic tilt, dropping back off the base of the pelvis tucking the tailbone under, breathing in as you go back and out as you return to the seated neutral position. To progress, increase the range of movement, dropping further back, aiming to lower one vertebra at a time as you move closer to the mat. If the hands are not needed on the return, remove from behind the thighs. Continue to progress your range of movement, eventually journeying all the way to the mat. Breathe out on the journey to the floor, taking a breath in at the bottom of the movement, and breathing out as you return to seated neutral. On the next return to the mat, progress further by bringing the arms over the head as you take a breath in, making sure to keep the spine in neutral. Raise the arms back up towards the ceiling and breathe out as you lift the body off the mat one vertebrae at a time, back up into seated position. To progress to the full version of the roll-up, lie in supine base position and stretch your arms above your head, keeping your legs straight and together with your toes pointed. Breathe in as you raise your arms up towards the ceiling, breathe out as you lift the body off the mat, rolling upwards and forwards up into seated base. Take a breath in and breathe out as you roll back down into the start position, keeping the movement smooth and flowing. Repeat 10 times.	Tilting the tailbone under/rocking back off the sitbones\nSpine like a string of pearls - lifting/lowering one at a time	Vertebrae being laid down/lifting from floor in chunks\nFeet lifting off floor\nAvoid internally rotating GH joint	Supine	240	\N	[]	2025-11-14 17:35:23.389542+00	2025-12-18 12:13:42.420929+00	2	the_roll_up	flexion	N	Y	Y	Y	https://lixvcebtwusmaipodcpc.supabase.co/storage/v1/object/public/movement-voiceovers/3.2-Roll_up.mp3	120	t	\N
ad5baa1a-012e-46d6-a61a-ab476f9fb59e	The Seal	Mat-based	Intermediate	Begin in seated neutral with the knees bent and the soles of the feet together.\nThread the arms inside the legs and take hold of the outside of the ankles, lifting the feet slightly off the mat into your balanced position.\nBreathe in as you roll back onto the shoulder blades, maintaining the rounded spine shape.\nBreathe out as you roll forward, returning to balance at the top.\nRepeat this smooth rocking motion 10 times.	TBC	Stay off neck\nKeep chest open\nEnsure to roll in a straight line	Seated	240	\N	[]	2025-11-14 17:35:24.876564+00	2025-12-18 12:13:42.420929+00	30	the_seal	flexion	N	N	N	Y	https://lixvcebtwusmaipodcpc.supabase.co/storage/v1/object/public/movement-voiceovers/3.30-Seal.mp3	70	t	\N
3f505bf5-7308-4b36-98d8-c738f750b6ed	Scissors	Mat-based	Intermediate	Set up level 1 of the Hundred with one leg off the floor. Breathe in to prepare and on the out-breath, lower the leg to the floor with control, keeping the angle at the knee joint at 90 degrees.\nTo progress, set up level 2 of the Hundred and alternate the legs in a scissor action one at a time.\nTo progress further, speed up the movement by making two movements to each breath.\nTo progress to the full version, lie supine on the mat and extend the legs. On the out-breath, lengthen and lift the leg to the ceiling, keeping it straight. Raise the opposite leg slightly off the floor. Alternate the legs in a scissor motion. Repeat 10 times with each leg.\nTo progress further, lift the head and grab the ankle of the leg approaching the face.	TBC	Movement should come from hip, avoid changing angle at knee joint (L1/L2)\nLoss of neutral	Supine	240	\N	[]	2025-11-14 17:35:24.198554+00	2025-12-18 12:13:42.420929+00	16	scissors	flexion	Y	Y	Y	Y	https://lixvcebtwusmaipodcpc.supabase.co/storage/v1/object/public/movement-voiceovers/3.16-Scissors.mp3	80	t	\N
6531979a-7d8e-4847-94ef-ee61e2453695	Spine stretch	Mat-based	Beginner	Set up seated base position with the legs slightly wider than hip distance apart. Begin by reaching forward with the arms, bringing the spine into forward flexion. Stretch as far forward as possible as you breathe out, returning back to the start position as you breathe in. Keep the movement flowing. Repeat 10 times.	Reaching up and over a ball\nBowing forward like a bendable 6ft fishing rod	Slumping forward into the stretch\nBouncing into the stretch	Seated	240	\N	[]	2025-11-14 17:35:23.847676+00	2025-12-18 12:13:42.420929+00	8	spine_stretch	flexion	N	N	N	Y	https://lixvcebtwusmaipodcpc.supabase.co/storage/v1/object/public/movement-voiceovers/3.8-Spine_stretch.mp3	60	t	\N
2ef7f37e-bbf8-4e59-aa45-46847e36495e	Rolling back	Mat-based	Beginner	Set up seated base, placing your hands on the floor, either side of your hips, and lower the chin towards the chest. Initiate the movement with a posterior pelvic tilt tucking in the chin and tucking the tailbone under, breathing in as you roll back, keeping the head and neck off the mat. Breath out as you return to seated base with your feet flat on the floor, using the hands to assist in the upward phase if needed. To progress, place the hands loosely on the shins, rolling back on the in-breath, and returning to seated neutral with your feet on the floor as you breathe out. To progress to the full version, return to a balanced position at the top of the movement, maintaining the feet off the floor. Initiate the next movement from this balanced position. Repeat 10 times.	Rolling like a ball\nRound the spine into a C shape\nTuck chin towards chest	Rolling back onto the neck\nThumping against the floor - slow down the speed of movement\nKeep the knees same distance apart from chest throughout and the heels the same distance from the glutes	Supine	240	\N	[]	2025-11-14 17:35:23.620462+00	2025-12-18 12:13:42.420929+00	5	rolling_back	flexion	N	Y	Y	Y	https://lixvcebtwusmaipodcpc.supabase.co/storage/v1/object/public/movement-voiceovers/3.5-Rolling_back.mp3	90	t	\N
b12a46d7-1f87-4e14-8463-3a7ed96980bf	Hip twist	Mat-based	Advanced	Sit tall on your sit bones with your legs extended in front of you and slightly apart, arms long by your sides or placed behind you for support. Lengthen through the spine and draw the abdominals in.\nBreathe in to prepare and on your out-breath, lean back into a gentle C-curve, keeping the chest open. Float both legs to tabletop or extend them long if available, maintaining steadiness through the pelvis.\nBreathe in as you rotate the legs together to one side, keeping the hips level. Breathe out as you return through centre and rotate to the opposite side, maintaining abdominal support.\nAfter your final repetition, return the legs to centre and lower them gently to the mat.	TBC	Avoid sinking into the shoulders\nAvoid leaning back too far	Seated	240	\N	[]	2025-11-14 17:35:24.516692+00	2025-12-18 12:13:42.420929+00	23	hip_twist	rotation	N	N	N	Y	https://lixvcebtwusmaipodcpc.supabase.co/storage/v1/object/public/movement-voiceovers/3.23-Hip_twist.mp3	80	t	\N
9ab2b968-2894-4637-bab9-80a20a74642f	One leg circle	Mat-based	Beginner	Set up level one of the hundred. With your leg in the coffee table position, place your hand on the knee and slowly start to make small circles using your hand as a guide. Breathe out as the leg moves away from the body and in on the return. To progress, take the hand away and start to make the circles bigger, maintaining neutral spine and keeping the pelvis stable. Keep the shin parallel to the floor throughout. To progress to the full version, lie supine on the mat, arms lengthened by your side, legs fully extended and toes pointed. Breathe out as you float the leg towards the ceiling, keeping it lengthened. Keeping the toes pointed, circle the leg away from the body as you breathe out, breathing in as you return the leg across the body back into the start position. Your breathing should dictate the speed of the movement. Repeat ten times on one leg, then repeat on the opposite leg.	Light shining from knee towards ceiling, draw circles, make bigger\nMaintain 90 degree angle at the knee joint	Movement coming from the knee or ankle\nOpposing leg 'wandering' away from midline\nPelvis tilting from the floor/loss of neutral pelvis	Supine	240	\N	[]	2025-11-14 17:35:23.538917+00	2025-12-18 12:13:42.420929+00	4	one_leg_circle	flexion	N	Y	Y	Y	https://lixvcebtwusmaipodcpc.supabase.co/storage/v1/object/public/movement-voiceovers/3.4-One_leg_circle.mp3	90	t	\N
f13dfb30-1eee-4683-90c4-e1842357d572	The Crab	Mat-based	Intermediate	Set up in seated neutral with your knees bent and the ankles crossed, taking hold of each foot with the opposite hand. Lift the feet off the mat into a balanced position. Breathe in as you roll back onto the shoulder blades, switching the cross of the ankles at the top of the movement. Breathe out as you roll forward and return to the balanced seated position. Repeat this flowing action 10 times.	TBC	Stay off neck\nControl speed of movement	Seated	240	\N	[]	2025-11-14 17:35:24.912704+00	2025-12-18 12:13:42.420929+00	31	the_crab	flexion	N	N	N	Y	https://lixvcebtwusmaipodcpc.supabase.co/storage/v1/object/public/movement-voiceovers/3.31-Crab.mp3	65	t	\N
4b837824-73f4-44f5-a32c-380938c18ced	Rocking	Mat-based	Advanced	Set up in a prone base position. Bend both knees to 90 degrees, tighten the abdominals and reach back to grab the front of your feet, gently drawing the heels in toward the glutes. Breathe in to prepare and on the out-breath lift the head and chest away from the mat, pressing the feet into the hands. Breathe in as you rock the body forward, and continue to rock back and forth with a smooth, flowing motion, keeping the front of the body open. Repeat up to 10 times, then gently release and lower back to the mat.	TBC	Avoid nodding head to create movement\nAvoid pulling feet into glutes	Prone	240	\N	[]	2025-11-14 17:35:24.961949+00	2025-12-18 12:13:42.420929+00	32	rocking	extension	N	N	N	Y	https://lixvcebtwusmaipodcpc.supabase.co/storage/v1/object/public/movement-voiceovers/3.32-Rocking.mp3	65	t	\N
8af0d203-24af-41fa-96e6-b26002f523a1	The Corkscrew	Mat-based	Intermediate	Set up supine neutral. Breathe out as you float your legs with the toes up towards the ceiling. Breathe in at the top of the movement, and as you raise the legs over your head, peel the spine away from the mat until the legs come parallel to the floor. Point and drop the legs slightly to one side so that your weight is now balancing slightly more on one side of your upper back. Breathe in, and on the out-breath begin to lower the body so that you are rolling down on one side of the spine only. Once the spine is back on the mat, repeat on the opposite side. Repeat this 10 times on each side.	Laying the side of your spine on the mat\nToes pointed to the ceiling	Abdominal doming/back arching/loss of neutral\nHunching the shoulders\nKeep legs together and straight\nAvoid too large a circle - keep controlled	Supine	240	\N	[]	2025-11-14 17:35:23.933781+00	2025-12-18 12:13:42.420929+00	10	the_corkscrew	rotation	N	N	N	Y	https://lixvcebtwusmaipodcpc.supabase.co/storage/v1/object/public/movement-voiceovers/3.10-Corkscrew.mp3	80	t	\N
