a111f2f2-1bb4-4415-b5a5-fd3f6667f5c1	One leg kick	Mat-based	Beginner	Lie prone on your mat, elbows under the shoulders, resting on your forearms, chest lifted, legs long.\nBreathe in to prepare and on your out-breath draw the abdominals in to support the spine.\nBend one knee, bringing the heel toward the seat for two small kicks, then extend the leg long again.\nSwitch legs, continuing the alternating kicks with precision and rhythm.\nLower gently to finish.	"Snap Kick"\nMaintain thigh parallel to floor	Loss of neutral - sagging into the back\nAvoid full leg extension between kicks	Prone	240	\N	[]	2025-11-14 17:35:24.060998+00	2025-12-18 12:13:42.420929+00	13	one_leg_kick	extension	N	N	N	Y	https://lixvcebtwusmaipodcpc.supabase.co/storage/v1/object/public/movement-voiceovers/3.13-One_leg_kick.mp3	70	t	\N
d9fb5c64-83fc-4c15-8552-31db8da27113	Double leg stretch	Mat-based	Beginner	Set up supine base with knees bent. Float the arms to the ceiling and start making small circles in opposite directions, gradually increasing the size of the circle. Breathe out as the arms move away from the body and breathe in as the arms are turned towards the midline. To progress, float the leg into level 1 of the 100 and continue to circle the arms wide with each breath cycle. To progress to the full version, lift the head and shoulders off the mat whilst bringing the legs into level 2 of the 100. Place the hands on the knees to start, breathing out as you circle the arms wide and over the head at the same time as you lengthen the legs away. Breathe in as you bring the arms back in towards the midline and return the legs to the start position. Repeat 10 times.	Lights shining from fingertips, draw circles in the ceiling\nDistance fingertips from toes\nKeep inner thighs connected when lengthening toes away	Abdominal dooming/back arching/loss of neutral\nRIbcage flaring with arms overhead	Supine	240	\N	[]	2025-11-14 17:35:23.763525+00	2025-12-18 12:13:42.420929+00	7	double_leg_stretch	flexion	Y	Y	Y	Y	https://lixvcebtwusmaipodcpc.supabase.co/storage/v1/object/public/movement-voiceovers/3.7-Double_leg_stretch.mp3	100	t	\N
879da3c4-155f-4fc7-9237-467019c880ae	Side kick	Mat-based	Beginner	Lie on your side in a long line, ankles, hips, and shoulders stacked. Point your arm toward the walls in the room, keeping it in line with your body and resting it under your head. Place your top hand lightly in front for support. Draw the abdominals in and find length through the spine.\n\nLevel 1:\nBreathe in to prepare and on your out-breath, lift the top leg to hip height, keeping it in line with your body.\nBreathe in as you point the leg forward with control, and breathe out as you return it behind you in line with the body, maintaining a stable pelvis.\n\nLevel 2:\nIncrease the range of forward and backward movement slightly while keeping the torso completely still. Maintain length from crown to toes and avoid rocking.\n\nFull version:\nRemove some stability support by placing your top hand on your hip. Continue the forward-and-back pointing action while keeping the hips and shoulders stacked and the waist lifted.\nLower the leg with control and switch sides.	TBC	Avoid arm movement to counter balance leg movement\nKeep balanced in side lying position	Supine	240	\N	[]	2025-11-14 17:35:24.428474+00	2025-12-18 12:13:42.420929+00	21	side_kick	lateral	N	Y	Y	Y	https://lixvcebtwusmaipodcpc.supabase.co/storage/v1/object/public/movement-voiceovers/3.21-Side_kick.mp3	120	t	\N
5a68e5f1-1915-4b9f-8f6d-b3de53dfae8d	One leg stretch	Mat-based	Beginner	Set up supine base on your back with knees bent. Inhale for preparation, and on the out-breath, slowly slide one leg away from the body along the floor, keeping the pelvis stable. Slide the leg back in on the in-breath. Keep your heel in contact with the floor throughout. Repeat on the opposite leg. To progress, set up level 1 of the 100. On the out-breath, slowly lengthen one leg away, bringing the thighs parallel and keeping the toes pointed. Breathe in as you return the leg to the start position. To progress further, set up level 2 of the 100. On the out-breath, slowly lengthen one leg away, to a 45-degree angle, keeping the opposite leg in the coffee table position, shin parallel to the floor. Breathe in as you return to the start position. Repeat on the opposite leg. To progress to the full version, lie supine on the mat. As you inhale, lift the head and shoulders off the mat, and draw the knee in towards the chest, keeping the opposite leg lengthened but lifted off the mat. Place one hand on your ankle, and the opposite hand on your knee. Breathe out as you alternate left and right leg, and breathe in as you alternate right and left leg again. Keep the head and shoulders lifted throughout. Repeat 10 times.	Drawing line in the sand with heel\nReaching toe towards the light switch\nScooping toe away from the body	Loss of neutral\nEven length on both sides of body in full version - avoid trunk shifting or leaning toward one side	Supine	240	\N	[]	2025-11-14 17:35:23.699133+00	2025-12-18 12:13:42.420929+00	6	one_leg_stretch	flexion	Y	Y	Y	Y	https://lixvcebtwusmaipodcpc.supabase.co/storage/v1/object/public/movement-voiceovers/3.6-One_leg_stretch.mp3	100	t	\N
