70e43aed-fc94-44e8-8fd0-9f1deed48989	Teaser	Mat-based	Advanced	Lie in your supine position with legs extended and arms reaching overhead or to the ceiling. Neutral spine, core engaged.\nBreathe in to prepare and on your out-breath, imprint the spine and peel the head, neck, and shoulders from the mat, allowing the legs to float to tabletop.\n\nContinue rolling up until you balance on your sit bones in your Teaser position, arms reaching parallel to the legs.\nTo progress, extend the legs, creating a V-shape. Maintain this position.\n\nTo challenge further, breathe out to roll down one vertebra at a time, lowering the legs and arms with control, then come back up to the V shape position. Repeat 10 times.\nFinish by lying back in your starting position.	Lower spine like a string of pearls to mat\nV sitting position	Maintain control of movement\nMaintain straight legs, toes pointed\nAllow only shoulder blades to touch mat	Seated	240	\N	[]	2025-11-14 17:35:24.471667+00	2025-12-18 12:13:42.420929+00	22	teaser	balance	N	Y	Y	Y	https://lixvcebtwusmaipodcpc.supabase.co/storage/v1/object/public/movement-voiceovers/3.22-Teaser.mp3	80	t	\N
