COPY public.cooldown_sequences (id, sequence_name, intensity_level, narrative, stretches, duration_seconds, target_muscles, recovery_focus, created_at, updated_at, required_muscle_groups, allow_ai_generation, voiceover_url, voiceover_duration, voiceover_enabled, video_url) FROM stdin;
1ea6dbdd-8f49-4106-97c4-1b503085ab28	Full Body Recovery	gentle	Settle onto your mat and take a long inhale. As you exhale, reach your arms overhead and stretch your legs long, feeling the whole body lengthen from fingertips to toes. Stay here for a few moments.\n\n\n\nWhen you’re ready, bring your arms down and let your knees drop over to one side. Keep the shoulders relaxed and let the spine gently unwind. Come back through centre and drop the knees to the other side, letting the breath soften any tightness.\n\n\n\nFrom here, roll onto your hands and knees and sink your hips back into Child's Pose. Let the arms reach forward or soften by your sides. Feel the back open and widen with each breath, releasing the hips and lower spine.\n\n\n\nWhen you're ready, come back onto your back. Extend one leg toward the ceiling for a gentle hamstring stretch, holding behind the thigh or calf—no pulling. Breathe deeply, then switch to the other side. Bring the knee in toward the chest for a glute stretch, \ncrossing the ankle over the opposite thigh if that feels good. Let the hips slowly release.\n\n\n\nNow hug both knees into your chest. Give yourself a small rock side to side, massaging through the lower back and easing out any remaining tension.\n\n\n\nRoll onto your side, release lower leg long along the mat and hold the opposite foot or ankle for a quad stretch, drawing the heel gently toward you. Keep the hips level and the breath easy. Switch sides when you're ready.\n\n\n\nCome to a comfortable seated or kneeling position. Interlace the fingers behind you for a gentle chest stretch, opening the front of the body and lifting the heart. Keep the ribs soft as you breathe. Then sweep one arm across the body for a shoulder stretch, drawing it in gently with the opposite hand. Switch sides, keeping the neck relaxed and the breath smooth.\n\n\n\nFinish with a slow inhale through the nose…and a long exhale through the mouth.	[{"name": "Child's Pose", "focus": "spine decompression", "duration": 45, "breathing": "deep diaphragmatic"}, {"name": "Supine Spinal Twist", "focus": "spinal rotation", "duration": 30, "breathing": "natural"}, {"name": "Figure-4 Hip Stretch", "side": "each", "focus": "hip flexors", "duration": 30}, {"name": "Supported Bridge Pose", "focus": "passive back bend", "duration": 60, "breathing": "relaxed"}]	240	{Spine,Hips,"Lower back",Shoulders}	Spinal decompression and hip release	2025-11-29 22:20:11.930986+00	2025-11-29 22:20:11.930986+00	{}	f	https://lixvcebtwusmaipodcpc.supabase.co/storage/v1/object/public/movement-voiceovers/4.cooldown_sequence.mp3	230	t	\N
