COPY public.preparation_scripts (id, script_name, script_type, narrative, key_principles, duration_seconds, created_at, updated_at, required_elements, allow_ai_generation, voiceover_url, voiceover_duration, voiceover_enabled, video_url) FROM stdin;
1a46a2dc-dc5c-43c0-84d3-55a28cf5150e	Pilates Principles Introduction	principles	Find a comfortable standing space wherever you're exercising today. Stand comfortably with your feet parallel or slightly turned out, hip-distance apart. Ensure your knees are soft and not locked. \nBalance your weight evenly through both feet. \nPlace your forearms on your waist with your elbows bent at about ninety degrees, arms pointing straight forward.\nRotate your pelvis forward and notice the forearms tip slightly downward.\nNow roll the pelvis backward, gently tucking the tailbone under, and notice the forearms tip slightly upward.\nGently rock between these two motions and find the midpoint where your fingertips come back to level with the floor. That position — where your fingertips point straight ahead — is your neutral pelvis. \n\n\n\nElongate the spine, imagining a string lifting the crown of the head upward. Roll the shoulders gently, allowing the shoulder blades to gently cinch and then widen across the back. \nKeep your chin level and your gaze forward. This is your neutral spine setup. \n\n\n\nNext, we'll set up your breathing. Gently draw your lower abdomen inward, as though zipping up a light corset or belt. \nPlace your hands on the base of your ribs, fingers touching. As you breathe in, allow the ribcage to widen to the sides and feel the breath move into the sides and back of the ribs. Keep the shoulders relaxed. \nAs you breathe out, feel the ribs draw softly back toward the centre and your fingertips come together again. This is lateral thoracic breathing.	{Centering,Concentration,Control,Precision,Breath,Flow}	120	2025-11-29 22:56:24.758149+00	2025-12-08 23:21:13.709236+00	[]	f	https://lixvcebtwusmaipodcpc.supabase.co/storage/v1/object/public/movement-voiceovers/1-Preparation-Phase.mp3	110	t	https://d1chkg8zq1g5j8.cloudfront.net/Generic_Placeholder.mp4
\.
