9074f146-a183-413d-b098-9b67c9dd2b2c	Comprehensive Full Body Warm-up	full_body	Let's begin our short warm-up before we move into the movement phase of the class.\n\nCome down onto your mat and lie comfortably on your back, knees bent and feet flat. Take a moment to settle.\n\nWe'll start with gentle pelvic tilts.\n\nOn your exhale, imprint the spine, closing the space between your lower back and the mat.\n\nInhale to release back to neutral, reopening that space.\n\nRepeat, noticing the change in range and control.\n\n\n\n\n\n\nNow we'll move into hip rolls.\n\nBring the heels toward the glutes.\n\nFrom neutral, exhale to peel the spine off the mat into a bridge, lifting only as high as feels comfortable.\n\nPause briefly at the top.\n\nExhale to roll the spine back down, one vertebra at a time.\n\nKeep the movement smooth and controlled. Repeat a few times.\n\n\n\n\n\n\nLet's open the upper back with ribcage arcs.\n\nStretch the legs long on the mat.\n\nInhale to take the arms overhead, stopping before the ribs flare.\n\nExhale to float the arms back above the chest, hands reaching upward.\n\nAllow the upper spine to open gently with each breath.\n\n\n\n\n\nNext, we'll add spinal rotation.\n\nBend the knees and open the arms out to the sides.\n\nInhale as both knees drift to one side.\n\nExhale to return through centre, then move to the other side.\n\nLet the movement stay easy and fluid. Repeat twice each way.\n\n\n\n\n\n\nWe'll continue into thoracic rotation.\n\nRoll onto your side with knees bent and arms stacked in front.\n\nExhale to open the top arm, allowing the chest to rotate toward the ceiling.\n\nInhale to return to centre.\n\nRepeat once more, then switch sides.\n\n\n\n\n\n\nCome up to a seated or kneeling position for shoulder mobilisation.\n\nGently roll the shoulders, letting the shoulder blades glide together and apart.\n\nThen create small, smooth arm circles forward and back, keeping the movement light.\n\n\n\n\n\n\nNow we'll mobilise the hips.\n\nLie back on your mat with knees bent and together.\n\nBring one leg into level 1 of the hundred, place the hand on the knee and gently make circles with the knee. Use your hand as a guide.\n\n\n\n\n\n\nNow change direction.\n\n\n\n\n\n\nNow switch legs.\n\n\n\n\n\n\nKeep the pelvis stable.\n\n\n\n\n\nThis is all about control, precision, and gentle activation.\n\nCome to a comfortable seated or standing position.\n\nFeel the breath steady, the spine long, and the body warm and ready to move.\n	[{"name": "Neck Rolls", "reps": 5, "direction": "each way", "description": "Gentle head circles to mobilize cervical spine"}, {"name": "Shoulder Circles", "reps": 8, "direction": "forward and back", "description": "Large arm circles"}, {"name": "Cat-Cow", "reps": 10, "description": "Spinal flexion and extension"}, {"name": "Hip Circles", "reps": 8, "direction": "each leg", "description": "Lying on back, leg circles in air"}, {"name": "Glute Bridge", "reps": 10, "description": "Activate glutes and hamstrings"}, {"name": "Chest Expansion", "reps": 8, "description": "Open chest, hands clasped behind back"}]	400	{"Acute injury in any area"}	{"easier": "Skip any painful movements", "harder": "Add breath holds, increase reps"}	Beginner	2025-12-03 20:37:51.828253+00	2025-12-09 00:29:34.97232+00	{"Hip Flexor Strengthening","Glute Strength","Spinal Mobility","Scapular Stability","Hamstring Strength","Chest Stretch"}	t	https://lixvcebtwusmaipodcpc.supabase.co/storage/v1/object/public/movement-voiceovers/2.warmup_routine_v2.mp3	390	t	https://d1chkg8zq1g5j8.cloudfront.net/Generic_Placeholder.mp4
